import React from 'react'
import ReactDOM from 'react-dom'
import App from "./App" 
import "./index.css"
import Sdata from "./Sdata"



function ncard(val) {
         return (
                <App 
         imgsrc={val.imgsrc}
         title={val.title}
         sname= {val.sname}
         link={val.link} /> 
         )

}



ReactDOM.render(
        <>
        <h1 className="heading_style"> Most Watched Netflix Webseries </h1>

         {Sdata.map(ncard)}

       </>

, document.getElementById('root'))
